import IconButton from '@mui/material/IconButton';
import { Facebook, Instagram, X, Email, WatchLater } from '@mui/icons-material';

function ContactInfo() {
    return (
        <div>
            <IconButton>
                <WatchLater />
            </IconButton>
            08:00 - 17:00
            <IconButton>
                <Email />
            </IconButton>
            DavidsGardeningServicesMedway@gmail.com
        </div>
    )
}

function SocialMedia() {
    return (
        <div>
            <IconButton size='small'>
                <Facebook />
            </IconButton>
            <IconButton>
                <Instagram />
            </IconButton>
            <IconButton>
                <X />
            </IconButton>
        </div>

    )
}

export default function TopSection() {
    return (
        <div className='Top-section'>
            <div className='Contact-Info-Top'>
                <ContactInfo />
            </div>
            <div className='Social-Media-Top'>
                <SocialMedia />
            </div>
        </div>
    )
}
